import './Index.css';
import React from 'react';
import AuthPage from './pages/AuthPage/AuthPage';


class Index extends React.Component {
    render(){
        return(
            <div className="Index">
                <h1>Index</h1>
                <AuthPage setUserInState={this.setUserInState}/>

            </div>
        )
    }
}

export default Index;
